column4:
Update monitoring.instrumentation.ui to use the Resource Browser, also update the JMX instrumentation to include the full path of the attributes.

Update the IInstrumentHandler to add the ILaunchConfiguration as a parameter to the handle method.
Change
public void handle(FilterSetElement filterElement, Element parent);
to
public void handle(FilterSetElement filterElement, Element parent, ILaunchConfiguration launchConfiguration);

I get an exception when removing a resource and then adding a new with the same path:

    CDOResource cdoResource = transaction.getOrCreateResource("/model1");
    transaction.commit();
    cdoResource.getContents().clear();
    transaction.getResourceSet().getResources().remove(cdoResource);
    transaction.commit();
    CDOResourceNode resourceNode = transaction.getResourceNode("/model1");
    CDOResource resource = transaction.getResource("/model1");

As exemplified with the following code:

&lt;body onUnload="if(flag)location.href='http://slashdot.org'"&gt;
&lt;a href="http://www.google.com" onMouseOver="window.status='test'"
onClick="flag=true"&gt;testing&lt;/a&gt;
&lt;/body&gt;

the location that a link will take you to can be spoofed.  The onMouseOver event
is there to show that even with the preference to disable scripts from changing
status bar text turned off, Firefox doesn't allow this to change the status bar.

